import React from 'react';


const ActivityList = ({ activity }) => {
    return (
        <select>
            <option selected disabled>Activity Type</option>
            {activity.map((activity) => (
                <option value={activity.sampleActivity} />
            ))}
        </select>
    )
}


export default ActivityList;
